    <script>
// support css asset retry
(function() {
  document.addEventListener('error', function(event) {
    try {
      if (!event) { return; }

      // get link element and make sure it has href
      var target = event.target || event.srcElement;
      if (!(target instanceof HTMLLinkElement)) { return; }
      if (!target.href) { return; }

      // do not retry assets twice
      if (target.getAttribute('data-retried') === 'yes') { return; }

      // main and backup cdn may be swapped on runtime, so do not assume they will not change
      var cdnHost = window.QCCDN_HOST || 'cloudcache.tencent-cloud.com';
      var backupCdnHost = window.QCCDN_BACKUP_HOST || 'cloudcache.tencentcs.com';

      // do not retry none target resources
      if (target.href.indexOf(cdnHost) === -1) { return }

      var newHref = target.href.replace(cdnHost, backupCdnHost);
      /** @type {HTMLLinkElement} */
      var newLink = target.cloneNode();
      newLink.href = newHref;
      newLink.setAttribute('data-retried', 'yes');
      target.replaceWith(newLink);
    }
    catch (err) {
      // ignore error for retry function
    }
  }, true);

})();
</script>

<script type="text/javascript">
  window.customWebpackJsonpLoader = function (context) {
    // create error before stack unwound to get useful stacktrace later
    var error = new Error();

    var chunkId = context.chunkId;
    var jsonpScriptSrc = context.jsonpScriptSrc;
    var installedChunks = context.installedChunks;
    var isPreviewNoHost;
    var url;

    // host for free preview configuration
    var exemptHost = 'cloudcache-preview.woa.com';

    seajs.use('nmc/insight/blames', function (blames) {
      var productId;
      var blame = blames.findBlame(error);
      if (blame && blame.productBlame !== 'invalid')
        productId = String(blame.productId);
      isPreviewNoHost =
        '' !== '1' &&
        window.g_buffet_data.previewProductId.split(',').indexOf(productId) >
          -1;

      url = replaceHost(jsonpScriptSrc(chunkId));
      seajs.use(url, verify);
    });

    // common func to replace domain flexible
    function replaceHost(src) {
      var url = new URL(src);
      if (isPreviewNoHost) url.host = exemptHost;
      else if (window['QCCDN_HOST']) url.host = window['QCCDN_HOST'];
      return url.href;
    }

    function verify() {
      // object to store loaded and loading chunks
      // undefined = chunk not loaded, null = chunk preloaded/prefetched
      // Promise = chunk loading, 0 = chunk loaded
      var chunk = installedChunks[chunkId];
      if (chunk !== 0) {
        // means the chunk make some error
        if (chunk) {
          error.message =
            'Loading chunk ' +
            chunkId +
            ' failed after several retries.\\n(' +
            url +
            ')';
          error.name = 'ChunkLoadError';
          error.request = url;
          chunk[1](error);
          installedChunks[chunkId] = undefined;
        } else {
          installedChunks[chunkId] = undefined;
        }
      }
    }
  };
</script>
